import './App.css';
import * as imp from './Components/Variable';

function App() {
  return (
    <div className="App">

      <h1> summation of two no. is : {imp.add( 40 , 60 )}</h1>
       <h1> difference of two no. is : {imp.sub( 40 , 60 )}</h1>
        <h1> multiplication of two no. is : {imp.mul( 40 , 60 )}</h1>
         <h1> division of two no. is : {imp.add( 40 , 60 )}</h1>

    </div>
  );
}

export default App;
